import Card from "./card/card.container";
import styles from "./"

const HomeView = ({ users, animalsList }) => 
  <div>
    <div className={styles.postContainer} >
      {animalsList.map(animal => 
        <Card animal={animal} users={users} />
      )}
    </div>
  </div>

export default HomeView;
